sap.ui.define(["trainning/bp000/controller/BaseController"],function(t){"use strict";return t.extend("trainning.bp000.controller.BPList",{onInit:function(){this.attachRoute("ToBPList",this.onRouteMatched)},onRouteMatched:function(){this.getView().getModel().refresh(true,false)},onDisplayPress:function(t){var e=t.getSource();var n=e.getBindingContext();var r=n.getObject().PartnerId;this.getRouter().navTo("ToBPDisplay",{PartnerId:r})},onEditPress:function(t){var e=t.getSource();var n=e.getBindingContext();var r=n.getObject().PartnerId;this.getRouter().navTo("ToBPEdit",{PartnerId:r})},onCreatePress:function(t){this.getRouter().navTo("ToBPCreate")},formatPartnerType:function(t){switch(t){case"1":return this.getText("txtOrganization");case"2":return this.getText("txtPerson");default:return""}},formatName:function(t,e){return t+" "+e}})});